TERMS-OF-USE.About-general-restriction-of-use:
Виин вас овим овлашћује да приступите и користите Услугу, у складу са следећим условима. Прихватате да непоштовање било ког од њих представља кршење ових Услова:

10.1 Слажете се да нећете дистрибуирати цео или било који део Веб локације или Услуге, укључујући Садржај, на било ком медију, осим ако Виин'с не пружа средства за такву дистрибуцију путем функције која се нуди као део Услуге;

10.2 Слажете се да нећете мењати нити мењати било који део веб локације или услуге;

10.3 Слажете се да нећете приступати Садржају на било који начин осим путем страница за репродукцију видео записа на самом веб сајту, Вииновог плејера или на било који други начин који Виин може изричито одредити у ту сврху;

10.4 Слажете се да нећете покушавати и нећете заобићи, онемогућити или на други начин ометати било коју безбедносну функцију Услуге или спречити или ограничити употребу или копирање Садржаја или наметнути било каква ограничења у коришћењу Услуге или Садржај доступан на Услузи;

10.5 Ако користите Виин'с Плаиер на својој веб локацији, не смете мењати, стварати изведено дело или блокирати било коју или све функционалности Виин'с Плаиера, укључујући, без ограничења, све везе до веб странице;

10.6 Слажете се да нећете користити или покретати било који аутоматизовани систем (укључујући, без ограничења, било ког робота, паука или офлајн плејера) са приступом Услузи на такав начин да шаље више порука захтева на Виин сервере у одређеном временском периоду од људско биће је могло разумно произвести у истом временском периоду користећи стандардни (тј. немодификовани) комерцијално доступан Интернет претраживач;

10.7 Слажете се да нећете прикупљати нити прикупљати никакве личне податке о било ком кориснику веб локације или било које услуге (и потврђујете да то укључује и имена налога Виина);

10.8 Слажете се да нећете користити Веб локацију и услугу (укључујући коментаре и функције е -поште на веб локацији) за тражење било какве комерцијалне активности или у вези са комерцијалним предузећем;

10.9 Слажете се да нећете тражити кориснике Веб локације у комерцијалне сврхе у вези са њиховим садржајем;

10.10 Слажете се да нећете приступати Садржају у било које друге сврхе осим личне некомерцијалне употребе како је предвиђено и допуштено нормалном функционалношћу Услуге, а искључиво у сврху истовременог дигиталног преноса података путем Интернета;

10.11 Нећете копирати, репродуцирати, дистрибуирати, преносити, емитирати, приказивати, продавати, лиценцирати или на било који други начин искориштавати било који Садржај у било коју другу сврху без претходног писаног пристанка Виина или одговарајућих даватеља лиценце Садржаја.
